import React from 'react';
import ReactDOM from 'react-dom/client';
import reportWebVitals from './reportWebVitals';
import { createBrowserRouter, RouterProvider } from "react-router-dom"
import { Provider } from 'react-redux';
import { LanguageProvider } from './context/LanguageContext';
import store from "./redux/store"
import './style.css';
import Layout from './components/Layout';
import IndexPage from './pages/index/IndexPage';
import ContactUs from './pages/contactus/ContactUs';
import ServicesPage from './pages/services/ServicesPage';
import WorksPage from './pages/works/WorksPage';
import CarGallery from './pages/cars/CarGallery';
import CarDetails from './pages/cars/CarDetails';
import NotFoundPage from './pages/notfound/NotFoundPage';

const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout><IndexPage /></Layout>
  },
  {
    path: "/iletisim",
    element: <Layout><ContactUs /></Layout>
  },
  {
    path: "/hizmetler",
    element: <Layout><ServicesPage /></Layout>
  },
  {
    path: "/galeri",
    element: <Layout><WorksPage /></Layout>
  },
  {
    path: "/arabalar",
    element: <Layout><CarGallery /></Layout>
  },
  {
    path: "/araba/:id",
    element: <Layout><CarDetails /></Layout>
  },
  {
    path: "*",
    element: <Layout><NotFoundPage /></Layout>
  }
]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Provider store={store}>
    <LanguageProvider>
      <RouterProvider router={router} />
    </LanguageProvider>
  </Provider>
);

reportWebVitals();
